import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar'; // Bara de navigație
import Cart from './components/Cart'; // Coșul de cumpărături
import Login from './components/Login'; // Pagina de login
import Register from './components/Register'; // Pagina de înregistrare

function App() {
  return (
    <Router>
      <Navbar /> {/* Bara de navigație va fi afișată pe toate paginile */}
      <Routes>
        <Route path="/" element={<h1>Bine ai venit pe magazinul nostru!</h1>} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="*" element={<h2>404 - Pagina nu a fost găsită</h2>} />
      </Routes>
    </Router>
  );
}

export default App;
